import React from 'react';
import './App.css';

function App() {
  return (
    <div className="text-center">
      <header className="bg-gray-800 p-5 text-white min-h-screen flex flex-col items-center justify-center text-2xl">
        <h1 className="mb-5 text-4xl font-bold">Welcome to PSI Engineering Systems !</h1>
        <p className="text-base max-w-2xl leading-relaxed">
          Edit <code className="bg-gray-200 text-gray-800 px-1 py-0.5 rounded font-mono">src/App.js</code> and save to reload.
        </p>
      </header>
    </div>
  );
}

export default App;
